//业主信息管理
   SELECT
   onr.OWNER_NAME AS 业主名称,
   onr.IDENT_NO AS 业主证件编码,
	 case
   onr.OWNER_BUSSINESS_TYPE
	 when '1' then '场租'
	 when '2' then '电费'
	 when '3' then '电租一体'
	 when '4' then '非场租非电费'
	 AS 业务类型,
	 case
   onr.owner_power_supply_type
     when '1' then '直供电'
	 when '2' then '转供电'
	 when '3' then '直供电+转供电'
     AS 供电类型,
   onr.owner_cust_code AS 客商编码,
   onr.OWNER_TEL AS 电话,
   onr.OWNER_ADDR AS 地址,
   onr.OWNER_MAIL AS 电子邮箱,
   onr.OWNER_LAW AS 业主企业法人,
    case
   onr.STATE_FLAG
    when '0' then '停用'
	when '1' then '启用'
    AS 业主状态,
   onl.LINKMAN_NAME AS 业主联系人姓名,
   onl.LINKMAN_MOBILE AS 手机
   from t_pcm_owner onr
   LEFT JOIN t_pcm_owner_linkman_detail onl
   on onr.OWNER_ID = onl.OWNER_ID
   WHERE onr.owner_cust_code='111';


  //收款账户信息
   SELECT
   ACCT_NUM AS 收款账号,
   ACCT_NAME AS 收款户名,
   ACCT_BANK AS 开户行名称,
   BELONG_BANK_NAME AS 所属银行,
    case
   ACCT_TYPE
    when '0' then '业主账号'
	when '1' then '委托收款人账号'
	AS 账户类别,
	case
   STATE_FLAG
    when '0' then '无效'
	when '1' then '有效'
    AS 账户状态,
   LAST_UPDATE_DATE AS 更新时间
   from
   t_pcm_contract_rela_acct
   where
   CONTRACT_CODE = '合同号'
   and STATE_FLAG='1';




SELECT
   s.STATION_CODE AS 站址编码,
   s.STATION_NAME AS 站址名称,
   CASE
   s.STATION_TYPE
   WHEN '21001001' THEN
				'地面站'
			WHEN '21001002' THEN
				'楼面站'
			WHEN '21001003' THEN
				'微站'
			WHEN '21001004' THEN
				'隧道站'
			WHEN '21001005' THEN
				'室内站'
			WHEN '21001006' THEN
				'虚拟站'
			ELSE
			NULL
			END
   AS 站址类型,
   s.DEAL_STATE AS 站址状态,
   s.STATION_SECOND_STATE AS 站址二级状态,
   r.`DELETE`  AS 删除状态,
   s.IS_VALID AS 是否有效,
   case
   c.`CODE`
   when c.code is null then '无' else '有' end
   AS 有无通信业务,
   case
   e.`CODE`
   when e.code is null then '无' else '有' end
   AS 有无能源务,
   case
   w.`CODE`
   when w.code is null then '无' else '有' end
   AS 有无智联业务,
   r.ORIGINAL_CODE AS 原运营商站址编码,
   r.ORIGINAL_NAME AS 原运营商站址名称,
   from
   t_pcm_station s
   LEFT JOIN t_pcm_station_communication c ON s.STATION_CODE = c.CODE
   LEFT JOIN t_pcm_station_energy e ON s.STATION_CODE = e.CODE
   LEFT JOIN t_pcm_station_wisdom w ON s.STATION_CODE = w.CODE
   LEFT JOIN t_pcm_station_physical p ON s.STATION_CODE = p.CODE
   LEFT JOIN t_pcm_station_resource r ON s.STATION_CODE = r.CODE
   WHERE s.STATION_CODE='11';





   SELECT
 s.STATION_CODE AS 站址编码,
 s.STATION_NAME AS 站址名称,
CASE
  s.STATION_TYPE
  WHEN '21001001' THEN
  '地面站'
  WHEN '21001002' THEN
  '楼面站'
  WHEN '21001003' THEN
  '微站'
  WHEN '21001004' THEN
  '隧道站'
  WHEN '21001005' THEN
  '室内站'
  WHEN '21001006' THEN
  '虚拟站' ELSE NULL
 END AS 站址类型,
CASE s.DEAL_STATE
 WHEN '0' THEN
 '未处理'
 WHEN '1' THEN
 '处理成功'
 WHEN '2' THEN
 '处理失败' ELSE NULL
END AS 站址状态,
CASE s.STATION_SECOND_STATE
 WHEN '1' THEN
 '新建交维未起租'
 WHEN '2' THEN
 '正常起租'
 WHEN '3' THEN
 '暂停计收'
 WHEN '4' THEN
 '保留站址' ELSE NULL
END AS 站址二级状态,
CASE r.`DELETE`
 WHEN '0' THEN
 '否'
 WHEN '1' THEN
 '是' ELSE NULL
END AS 删除状态,
CASE
  s.IS_VALID
  WHEN '0' THEN
  '无效'
  WHEN '1' THEN
  '有效' ELSE NULL
 END AS 是否有效,
CASE
  c.`CODE`
  WHEN c.CODE IS NULL THEN
  '无' ELSE '有'
 END AS 有无通信业务,
CASE
  e.`CODE`
  WHEN e.CODE IS NULL THEN
  '无' ELSE '有'
 END AS 有无能源务,
CASE
  w.`CODE`
  WHEN w.CODE IS NULL THEN
  '无' ELSE '有'
 END AS 有无智联业务,
 r.ORIGINAL_CODE AS 原运营商站址编码,
 r.ORIGINAL_NAME AS 原运营商站址名称,

FROM
 t_pcm_station s
 LEFT JOIN t_pcm_station_communication c ON s.STATION_CODE = c.
 CODE LEFT JOIN t_pcm_station_energy e ON s.STATION_CODE = e.
 CODE LEFT JOIN t_pcm_station_wisdom w ON s.STATION_CODE = w.
 CODE LEFT JOIN t_pcm_station_physical p ON s.STATION_CODE = p.
 CODE LEFT JOIN t_pcm_station_resource r ON s.STATION_CODE = r.CODE
WHERE
 s.STATION_CODE = '11';









SELECT
  n1.ORGNAME AS '省份',
 n2.ORGNAME AS '地市',
 c.contract_code '合同的合同编码',
 a.CONTRACT_CODE '卡片的合同编码',
 a.CARD_CODE '卡片编码',
 CASE a.CARD_STATE
WHEN '01' THEN
 '有效'
WHEN '02' THEN
 '已结转'
ELSE
 NULL
END AS '卡片状态',
 a.STATION_CODE '站址编码',
 (
 CASE a.BUSINESS_CODE_TYPE
 WHEN '01' THEN
  "主营业务编码"
 WHEN '02' THEN
  "智联业务编码"
 WHEN '03' THEN
  "能源业务编码"
 END
) AS '业务编码类型',
 a.BUSINESS_CODE AS '业务编码',
 CASE a.CARD_ACCOUNTANT_COURSE
WHEN '01' THEN
 '长摊'
WHEN '02' THEN
 '待摊'
ELSE
 NULL
END AS '卡片会计科目',
 CASE a.CARD_SOURCE
WHEN '01' THEN
 '合同'
WHEN '02' THEN
 '存量接收长摊'
WHEN '03' THEN
 '办公房屋租赁'
ELSE
 NULL
END AS '卡片来源',
