 a.ACCUMULATED_AMORTIZATION AS '累计摊销',
 a.ACCOUNT_PAYABLE AS '应付款',
 DATE_FORMAT(
 a.AMORTIZATION_BEGIN_DATE,
 "%Y%m"
) AS '摊销起始年月',
 DATE_FORMAT(
 a.AMORTIZATION_END_DATE,
 "%Y%m"
