 CASE a.CARD_CARRY_FORWARD_DATE
WHEN '0000-00-00' THEN
 NULL
ELSE
 a.CARD_CARRY_FORWARD_DATE
END AS '卡片结转日期',
DATE_FORMAT(
  a.CARD_ESTIMATE_CARRY_DATE,
   "%Y%m")
    as '暂估计提日期'
